import React,{Fragment} from 'react'
import Head from 'next/head'
import '../../../styles/styles.css'

const Layout = props => {
  return (
    <Fragment>
    <Head>
      <title>Page</title>
    </Head>
    <div className={props.className}>
    {
      props.children
    }
    </div>
    </Fragment>
  )
}

export default Layout
